import React, { Component } from 'react'
import { Box, TextField } from '@material-ui/core';

const styles = theme => ({
    textField: {
        width: '90%',
        marginLeft: 'auto',
        marginRight: 'auto',
        paddingBottom: 0,
        marginTop: 0,
        fontWeight: 500
    },
    input: {
        color: 'white'
    }
});
export default class DescriptionField extends Component {

    render() {
        const classes = styles();
        return (
            <Box  >
                <TextField
                    id="email"
                    label="Email"
                    className={classes.textField}
                    value={this.state.form_email}
                    onChange={this.handle_change('form_email')}
                    margin="normal"
                    InputProps={{
                        className: classes.input,
                    }}
                />
            </Box >

        )
    }
}
